/*Table structure for table `sys_userinfo` */

DROP TABLE IF EXISTS `sys_userinfo`;

CREATE TABLE `sys_userinfo` (
  `UserID` varchar(36) NOT NULL COMMENT '用户ID',
  `UserName` varchar(32) DEFAULT NULL COMMENT '用户名',
  `Account` varchar(32) DEFAULT NULL COMMENT '登录账号',
  `PasswordHash` varchar(32) DEFAULT NULL COMMENT '登录密码',
  `Email` varchar(32) DEFAULT NULL COMMENT 'Email',
  `CompanyName` varchar(256) DEFAULT NULL COMMENT '单位名称',
  `ContactAddress` varchar(256) DEFAULT NULL COMMENT '通讯地址',
  `Telephone` varchar(36) DEFAULT NULL COMMENT '联系电话',
  `IsActive` int(11) DEFAULT NULL COMMENT '是否启用',
  `ModifyUserID` varchar(36) DEFAULT NULL COMMENT '修改人',
  `UpdateTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  `Remark` varchar(256) DEFAULT NULL COMMENT '备注',
  `PicturePath` varchar(256) DEFAULT NULL COMMENT '个人头像路径',
  `E_Signature` varchar(256) DEFAULT NULL COMMENT '电子签名',
  `AreaID` varchar(36) DEFAULT NULL COMMENT '区域ID',
  `MobilePhone` varchar(20) DEFAULT NULL COMMENT '手机',
  `Fax` varchar(36) DEFAULT NULL COMMENT '传真',
  `UserNO` varchar(36) DEFAULT NULL COMMENT '员工工号',
  `PhoneExt` varchar(36) DEFAULT NULL COMMENT '分机号',
  `GuestRole` int(11) DEFAULT NULL COMMENT 'GuestRole（客户管理权限）',
  `OrderNO` int(11) DEFAULT NULL COMMENT '排序号',
  `Qualifications` varchar(256) DEFAULT NULL COMMENT '人员资质',
  `GroupID` varchar(36) DEFAULT NULL COMMENT '团队ID',
  `OpenID` varchar(256) DEFAULT NULL COMMENT '微信ID',
  `UserPost` varchar(20) DEFAULT NULL COMMENT '用户职务',
  `ShortPhone` varchar(36) DEFAULT NULL COMMENT '短号',
  `PwdTime` datetime DEFAULT NULL COMMENT '密码更新时间',
  `UnionID` varchar(64) DEFAULT NULL COMMENT '微信UnionID',
  `AppletOpenID` varchar(36) DEFAULT NULL COMMENT '小程序OpenID',
  `RoleID` varchar(36) DEFAULT NULL,
  PRIMARY KEY (`UserID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

